              "children": [
                {
                  "kind": "span",
                  "text": "Pacing (X/Y) Fractional Timer\\n The pacing timer produces TREQ\n"
                },
                {
                  "kind": "span",
                  "text": "assertions at a rate set by ((X/Y) * sys_clk). This equation is\n"
                },
                {
                  "kind": "span",
                  "text": "evaluated every sys_clk cycles and therefore can only generate TREQs at\n"
                },
                {
                  "kind": "span",
                  "text": "a rate of 1 per sys_clk (i.e. permanent TREQ) or less.\n"
                }
              ]
